import * as React from 'react';
import {
    DataGrid,
    GridToolbarContainer,
    GridToolbarColumnsButton,
    GridToolbarFilterButton,
    GridToolbarDensitySelector,
    GridToolbarExport,
} from '@mui/x-data-grid';
import { 
    createTheme,
    ThemeProvider } from '@mui/material/styles';
import { green, purple } from '@mui/material/colors';

const theme = createTheme({
    palette: {
        primary: {
        main: purple[500],
        },
        secondary: {
        main: green[500],
        },
    },
});

function CustomToolbar() {
  return (
    <GridToolbarContainer>
      <GridToolbarColumnsButton />
      <GridToolbarFilterButton />
      <GridToolbarDensitySelector />
      <GridToolbarExport />
    </GridToolbarContainer>
  );
}
const columns = [
    {
      field: 'ticker',
      headerName: 'Ticker',
      width: 150,
      editable: true,
    },
    {
        field: 'ceiling',
        headerName: 'Ceiling',
        type: 'number',
        width: 150,
        editable: true,
      },
    {
      field: 'floor',
      headerName: 'Floor',
      type: 'number',
      width: 150,
      editable: true,
      
    },
    {
      field: 'highest',
      headerName: 'Highest',
      type: 'number',
      width: 150,
      editable: true,
    },
    {
      field: 'lowest',
      headerName: 'Lowest',
      type: 'number',
      width: 150,
      editable: true,
    },
    {
      field: 'match',
      headerName: 'Match',
      type: 'number',
      width: 150,
      editable: true,
    },
    {
      field: 'volume',
      headerName: 'Volume',
      type: 'number',
      width: 150,
      editable: true,
    },
  ];
  const rows = [
    { id: 1, ticker: 'ACB', ceiling: 305, floor: 3.7, highest: 67, lowest: 4.3, match: 0.4, volume: 2300 },
    { id: 2, ticker: 'ASM', ceiling: 262, floor: 16.0, highest: 24, lowest: 6.0, match: 4.8, volume: 900 },
    { id: 3, ticker: 'BVH', ceiling: 375, floor: 0.0, highest: 94, lowest: 0.0, match: 1.4, volume: 1000 },
    { id: 3, ticker: 'DGC', ceiling: 318, floor: 0.0, highest: 81, lowest: 2.0, match: 4.8, volume: 1500 },

    { id: 4, ticker: 'BCM', ceiling: 159, floor: 6.0, highest: 24, lowest: 4.0,match: 9.3,volume: 1200},
    { id: 5, ticker: 'BHN', ceiling: 356, floor: 16.0, highest: 49, lowest: 3.9,match: 1.4,volume: 700},
    // ('BID', 408, 3.2, 87, 6.5,1.4,1000),
    // ('BMP', 237, 9.0, 37,1.4, 4.3,1000),
    // ('BVH', 375, 0.0, 94, 0.0,1.4,1000),
    // ('CII', 518, 26.0, 65, 7.0,4.8,1000),
    // ('DCM', 392, 0.2, 98, 0.0,4.8,1000),
    // ('DGC', 318, 0, 81, 2.0,4.8,1000),
    // ('DGW', 360, 19.0, 9,4.8, 37.0,1000),
    // ('DHC', 437, 18.0, 63, 4.0,4.8,1000),
    // ('FLC', 437, 18.0, 63, 4.0,4.8,1000),
    // ('FPT', 437, 18.0, 63, 4.0,4.8,1000),
    // {ticker:'X20', 437, 18.0, 63, 4.0,4.8,1000},
  ]; 
    

  export default function DataGridDemo() {
    <ThemeProvider theme={theme}>
    <Container style={{textAlign: "center"}}>
    return (
        <div style={{ height: 400, width: '100%', color: 'white',backgroundColor: "black"}}>
        <DataGrid
            rows={rows}
            columns={columns}
            
            components={{
            Toolbar: CustomToolbar,
            }}
            initialState={{
                sorting: {
                  sortModel: [{ field: 'ticker', sort: 'asc' }],
                },
              }}
            alignItems="center"
            justifyContent="center"
        />
        </div>
    );
    </Container>
    </ThemeProvider>
}
